import React from "react";
import "./contact.css";

const Footer = () => {
  return (
    <div className="section__padding">
      <div className="contact__section">
        <div className="contact__section-title">
          <h1>CONTACT ME</h1>
          <div className="contact__section-outercontainer"></div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
